import Dashboard from '../components/Dashboard/Dashboard';

const addlisting = ()=>{
    const submitForm = async(user, text)=>{
        //listingDetails, listingPhotos
        // let formData = new FormData();
        // formData.append('details', listingDetails);
        // formData.append('images', listingPhotos);
        const dataToPost = {
            name: text,
            user: user
        }

        const res = await fetch('http://localhost:3004/listings', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(dataToPost)
        });
        const data = await res.json();
        console.log('Success', JSON.stringify(data));
    }

    return <Dashboard route="add-listing" addListing={submitForm}/>;
}

export default addlisting;
